// App.js
import React from 'react';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import Hero from './components/Hero'; // Import your Hero component
import AllProducts from './pages/AllProducts'; // Import your AllProducts component

function App() {
  return (
    <BrowserRouter>
      <Switch>
        <Route path="/" exact component={Hero} />
        <Route path="/pages/AllProducts" component={AllProducts} />
      </Switch>
    </BrowserRouter>
  );
}

export default App;
